import React from 'react';
import temple from '../img/temple-mini.png'

const style = {
    color: '#ffffff',
    backgroundColor: '#9e3500',
    backgroundImage: `url(${temple})`,
    backgroundSize: '100%',
    backgroundRepeat: 'no-repeat',
    minWidth: '20%',
    maxWidth: 500,
    minHeight: '10%',
    maxHeight: 150,
};

export default function Home() {
    return (
        <div style={style}>
        </div>
    );
}
